import React from 'react';
import FeaturesSection from './FeaturesSection';
import ServicesSection from './ServicesSection';
import AmbientsSection from './AmbientsSection';
import InstallationsSection from './InstallationsSection';

function PrincipalSection() {
  return (
    <section id="principal">
      <h2>Sección Principal</h2>
      <div className="sesion-principal">
        <h4>Prueba</h4>
        <a href="https://www.google.com.ar/maps" className="linkmap">Ver lugar</a>
      </div>
      <br />
      <div className="container">
        <i className="fas fa-car" style={{ color: '#4f4f4f' }}></i>
        <span className="text">m²</span>
        <i className="fas fa-expand-arrows-alt" style={{ color: '#4f4f4f' }}></i>
        <span className="text">m²</span>
        <i className="fas fa-bed" style={{ color: '#4f4f4f' }}></i>
        <span className="text">Dormitorios</span>
        <i className="fas fa-shower" style={{ color: '#4f4f4f' }}></i>
        <span className="text">Baños</span>
        <i className="fas fa-car" style={{ color: '#4f4f4f' }}></i>
        <span className="text">Coche</span>
      </div>
      <br />
      <hr />
      <br />

      {/* Secciones internas */}
      <FeaturesSection />
      <ServicesSection />
      <AmbientsSection />
      <InstallationsSection />
    </section>
  );
}

export default PrincipalSection;
